const mongoose = require("mongoose"); // mongoose mongoose  .
const dotenv = require("dotenv");

const connect = () => {
  if (process.env.NODE_ENV !== `production`) {
    mongoose.set("debug", true); // debug .
  }

  mongoose.connect(
    `mongodb://${process.env.DB_ID}:${process.env.DB_PASSWORD}@${process.env.DB_HOST}:${process.env.DB_PORT}`,
    {
      dbName: process.env.DB_NAME,
      useNewUrlParser: true,
      useCreateIndex: true,
      // `` <--     , ${process.env.DB} <-- dotenv   DB
    },
    (error) => {
      if (error) {
        console.log(error);
        console.log(` FAILED TRY AGAIN`);
      } else {
        console.log(` MONGODB CONNECTION SUCCEES`);
      }
    }
  );
};

mongoose.connection.on(`error`, (error) => {
  console.log(error);
  console.log(` CONNECTION FAILED TRY AGAIN`);
  connect();
});

mongoose.connection.on(`disconnect`, () => {
  console.log(` CONNECTION FAILED TRY AGAIN`);
  connect();
});

module.exports = connect;

